import React from "react";

import { Avatar, Stack } from "@mui/material";
import { deepOrange, green, red } from "@mui/material/colors";

const AvatarOptionList = ({ currenttype, setCurrenttype, titles }) => {
  const backGroundColor = (title) => {
    return currenttype === title ? "red" : "#2e95bd";
  };
  return (
    <Stack direction="column" spacing={2} sx={{ m: 1 }}>
      {titles.map((title) => (
        <Avatar
          className="ripple"
          onClick={() => console.log("clicked")}
          sx={{
            m: "auto",
            width: 100,
            height: 100,
            bgcolor: backGroundColor(title),
          }}
        >
          {title}
        </Avatar>
      ))}
      <Avatar
        className="ripple"
        onClick={() => console.log("clicked")}
        sx={{
          m: "auto",
          width: 100,
          height: 100,
          bgcolor: red["A700"],
        }}
      >
        OG
      </Avatar>
      <Avatar
        className="ripple"
        onClick={() => console.log("clicked")}
        sx={{
          m: "auto",
          width: 100,
          height: 100,
          bgcolor: "#2e95bd",
        }}
      >
        Legend
      </Avatar>
      <Avatar
        className="ripple"
        onClick={() => console.log("clicked")}
        sx={{ m: "auto", width: 100, height: 100, bgcolor: "#2e95bd" }}
      >
        UnderDog
      </Avatar>
      <Avatar
        className="ripple"
        onClick={() => console.log("clicked")}
        sx={{ m: "auto", width: 100, height: 100, bgcolor: "#2e95bd" }}
      >
        Upcoming
      </Avatar>
      <Avatar
        className="ripple"
        onClick={() => console.log("clicked")}
        sx={{ m: "auto", width: 100, height: 100, bgcolor: "#2e95bd" }}
      >
        OG
      </Avatar>
    </Stack>
  );
};

export default AvatarOptionList;
